import React from "react";
import axios from "axios";
import { urlRead, urlCreate, urlDelete } from "../endpoints";

export default function Contacts() {
  const [data, setData] = React.useState([]);

  async function getData() {
    try {
      const response = await axios.get(urlRead);
      console.log(response);
      setData(response.data);
    } catch (err) {
      console.error(err);
    }
  }

  React.useEffect(() => {
    getData();
  }, []);

  const sortData = (e) => {
    setData((prevState) =>
      prevState.sort((a, b) =>
        a[e.target.name] > b[e.target.name]
          ? 1
          : b[e.target.name] > a[e.target.name]
          ? -1
          : 0
      )
    );
  };

  return (
    <div>
      <button onClick={() => console.log(data)}>TEST</button>
      <table>
        <thead>
          <tr>
            <th name="email" onClick={() => console.log(data)}>
              email
            </th>
            <th>domain</th>
            <th>created</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row) => {
            return (
              <tr>
                <th>{row.email}</th>
                <th>{row.domain}</th>
                <th>{row.date}</th>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
